script: |
  super -f text -I q552.spq | sort > q552.out

inputs:
  - name: q552.spq
    data: |
      SELECT DISTINCT col0 * - - col1 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE + col0 NOT BETWEEN - col0 + + + 67 AND + 61;
  - name: tab1

outputs:
  - name: q552.out
    data: |
      425
      4277
